<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Bookmark Manager-RKP</title>
</head>

<body>
    <h1>My Bookmark</h1>
    <ol>
        <li><h3>Primary Bookmark</h3></li>
        <ul type="square">
            <li><a href="https://www.google.com">Open Google</a></li>
            <li><a href="https://www.facebook.com">Open facebook</a></li>
            <li><a href="https://www.youtube.com">Open YouTube</a></li>
            <li><a href="https://www.quora.com">Open Quora</a></li>
            <li><a href="https://www.instagram.com">Open Instagram</a></li>
        </ul>
        <li><h3>Secondary Bookmark</h3></li>
        <ul type="square">
            <li><a href="https://www.wikipedia.com">Open wikipedia</a></li>
            <li><a href="https://www.codewithharry.com">Open codewithharry</a></li>
            <li><a href="https://www.stackoverflow.com">Open stackoverflow</a></li>
        </ul>
    </ol>
</body>

</html>
